import React from 'react'; 
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Button from '@material-ui/core/Button';
import Fab from '@material-ui/core/Fab';
import AddIcon from '@material-ui/icons/Add';
import { memberList } from '../store/modules/member';
import 'App.css';

const BoardList = () => {
    return(
    <div className="board-container">
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>id</TableCell>
            <TableCell>name</TableCell>
            <TableCell align="right">rank</TableCell>
            <TableCell align="right">department</TableCell>
            <TableCell align="right">
              <Fab size="small" color="secondary" aria-label="add" className=""><AddIcon /></Fab>
            </TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {memberList.map((memberList, index) => (
            <TableRow key={index} hover role="checkbox">
              <TableCell component="th" scope="row">{memberList.id}</TableCell>
              <TableCell component="th" scope="row">{memberList.name}</TableCell>
              <TableCell align="right">{memberList.rank}</TableCell>
              <TableCell align="right">{memberList.department}</TableCell>
              <TableCell align="right">
                <Button color="primary" className="">수정</Button>
                <Button color="secondary" className="">삭제</Button>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </div>
    );
}

export default BoardList;
